import React from 'react';
// import { useSelector, useDispatch } from 'react-redux';
// import Snackbar from '@material-ui/core/Snackbar';
// import MuiAlert from '@material-ui/lab/Alert';
// import { IApplicationState, hideMessage } from '../../store';
import Button from '@material-ui/core/Button';
import { Link } from 'react-router-dom';
import './style.scss';
import { useState } from 'react';

export const Sidebar = () => {
	const [activeTab, setActiveTab] = useState('overview');
	const heandalActiveTab = (tab) => {
		setActiveTab(tab);
	};

	return (
		<div className='sider_bar'>
			<div className='sider_bar__title'>
				<h2>TIMLARA</h2>
			</div>
			<div className='sider_bar__content'>
				<div className='sider_bar__content--list'>
					<Button
						variant='contained'
						onClick={() => {
							heandalActiveTab('overview');
						}}
						className={activeTab === 'overview' ? 'active' : ''}
					>
						<Link to='/'>Tổng quan</Link>
					</Button>
				</div>
				<div className='sider_bar__content--list'>
					<Button
						variant='contained'
						onClick={() => {
							heandalActiveTab('package');
						}}
						className={activeTab === 'package' ? 'active' : ''}
					>
						<Link to='/package'>Gói tin</Link>
					</Button>
				</div>
				<div className='sider_bar__content--list'>
					<Button
						variant='contained'
						onClick={() => {
							heandalActiveTab('');
						}}
						className={activeTab === '' ? 'active' : ''}
					>
						<Link to='/account-information'>Dịch vụ</Link>
					</Button>
				</div>
				<div className='sider_bar__content--list'>
					<Button
						variant='contained'
						onClick={() => {
							heandalActiveTab('advertisement');
						}}
						className={activeTab === 'advertisement' ? 'active' : ''}
					>
						<Link to='/advertisement'>Chiến dịch</Link>
					</Button>
				</div>
				<div className='sider_bar__content--list'>
					<Button
						variant='contained'
						onClick={() => {
							heandalActiveTab('store');
						}}
						className={activeTab === 'store' ? 'active' : ''}
					>
						<Link to='/store'>Cửa hàng</Link>
					</Button>
				</div>
				<div className='sider_bar__content--list'>
					<Button
						variant='contained'
						onClick={() => {
							heandalActiveTab('');
						}}
						className={activeTab === '' ? 'active' : ''}
					>
						<Link to='/account-information'>Tin đăng</Link>
					</Button>
				</div>
				<div className='sider_bar__content--list'>
					<Button
						variant='contained'
						onClick={() => {
							heandalActiveTab('');
						}}
						className={activeTab === '' ? 'active' : ''}
					>
						<Link to='/account-information'>Giao dịch</Link>
					</Button>
				</div>
				<div className='sider_bar__content--list'>
					<Button
						variant='contained'
						onClick={() => {
							heandalActiveTab('account');
						}}
						className={activeTab === 'account' ? 'active' : ''}
					>
						<Link to='/account'>Thành viên</Link>
					</Button>
				</div>
				<div className='sider_bar__content--list'>
					<Button
						variant='contained'
						onClick={() => {
							heandalActiveTab('');
						}}
						className={activeTab === '' ? 'active' : ''}
					>
						<Link to='/account-information'>Thông báo</Link>
					</Button>
				</div>
				<div className='sider_bar__content--list'>
					<Button
						variant='contained'
						onClick={() => {
							heandalActiveTab('');
						}}
						className={activeTab === '' ? 'active' : ''}
					>
						<Link to='/account-information'>Danh mục</Link>
					</Button>
				</div>
				<div className='sider_bar__content--list'>
					<Button
						variant='contained'
						onClick={() => {
							heandalActiveTab('');
						}}
						className={activeTab === '' ? 'active' : ''}
					>
						<Link to='/account-information'>Báo cáo thống kê</Link>
					</Button>
				</div>
				<div className='sider_bar__content--list'>
					<Button
						variant='contained'
						onClick={() => {
							heandalActiveTab('');
						}}
						className={activeTab === '' ? 'active' : ''}
					>
						<Link to='/account-information'>Cấu hình</Link>
					</Button>
				</div>
			</div>
		</div>
	);
};
